import { useEffect } from 'react/cjs/react.development'
import { useGetUser } from '../../hooks/useGetUser'




export const Menu =()=>{

    [ getCheckUser ] = useGetUser()

    useEffect(()=>{
        getCheckUser()
    })
    return(
        <>
        </>
    )

}
